import React from 'react'
import {Wrapper, H1} from '../Styled';

import styled from "styled-components";


const Container = styled(Wrapper)`
    border: 2px solid var(--s-3);
    border-radius:.5em;
`

export default function Contact() {
    return (
        <Container>
            <H1>Contact</H1>
        </Container>
    )
}
